            <div className="title">
                <h1>I am Main Components</h1>
                <p></p>
                <div className="row">
                    <button className="rounded border col-1 mx-2">-</button>
                    <div className="rounded-pill border col-2 text-center mx-2">0</div>
                    <button className="rounded border col-1 mx-2">+</button>
                </div>
            </div>
        </div>
    </div>
  </>;
};

export default Main;
